import React, {Component} from 'react';
import { Map, Marker, Popup, TileLayer } from 'react-leaflet';
import L from 'leaflet';


delete L.Icon.Default.prototype._getIconUrl;

L.Icon.Default.mergeOptions({
    iconRetinaUrl: require('leaflet/dist/images/marker-icon-2x.png'),
    iconUrl: require('leaflet/dist/images/marker-icon.png'),
    shadowUrl: require('leaflet/dist/images/marker-shadow.png')
});
const position = [17.440081, 78.348915];
class Maps extends Component {

  handleClick = (e) => {
    this.props.setMarker({
      latitude: e.latlng.lat,
      longitude: e.latlng.lng 
    });
  };


  render() {
    return (
      <Map
        ref={this.mapRef}
        center={position} 
        zoom={13} 
        style={{ height: '600px', width: '1800px' }}
      >
        <TileLayer
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"

        />
        {
            <Marker position={[parseFloat(this.props.lat.latitude), parseFloat(this.props.long.longitude)]}>
            <Popup>latitude:{this.props.lat.latitude}<br />longitude:{this.props.long.longitude} <br/></Popup>
            </Marker>
        }
      </Map>
    );
  }
}

export default Maps;
